class Solution:
    def getListOfFactors(self, num: int) -> set:
        s = set()

        if num <= 1:
            return s

        while(num % 2 == 0):
            s.add(2)
            num //= 2

        for i in range(3, int(sqrt(num))+1, 2):
            while(num % i == 0):
                s.add(i)
                num //= i

        if num > 1:
            s.add(num)

        return s

    def minJumps(self, nums: List[int]) -> int:
        # resource.setrlimit(resource.RLIMIT_AS, (1000*1024*200,1000*1024*200))

        n = len(nums)
        primes = {}

        for i, num in enumerate(nums):
            factors = self.getListOfFactors(num)
            
            for factor in factors:
                if factor in primes:
                    primes[factor].append(i)
                else:
                    primes[factor] = [i]

        print('primes: ', primes)

        q = deque([(0, 0)])# indx, distance
        visited = [False]*n

        visited[0] = True

        while(len(q)):
            node, distance = q.popleft()

            if node == n-1:
                return distance

            if node > 0 and not visited[node-1]:
                q.append((node-1, distance+1))
                visited[node] = True

            if node < n-1 and not visited[node+1]:
                q.append((node+1, distance+1))
                visited[node] = True

            # print('node: ', node)
            # print('primes[nums[node]]: ', primes[nums[node]])

            if nums[node] in primes:
                indexesToJump = primes[nums[node]]

                for i in indexesToJump:
                    if not visited[i]:
                        q.append((i, distance+1))
                        visited[i] = True

                del primes[nums[node]]

        return -1
